import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import Nav from "./Common/Nav";

export default function Education() {
    const handleLogout = () => {
        sessionStorage.removeItem('Auth Token');
        navigate('/login')
    }
    let navigate = useNavigate();
    useEffect(() => {
        let authToken = sessionStorage.getItem('Auth Token')
        console.log(authToken)
        if (authToken) {
            navigate('/education')
        }

        if (!authToken) {
            navigate('/login')
        }
    }, [])
    return (
        <div>
            Education Page

            <button onClick={handleLogout}>Log out</button>
            <Nav />
            <Field
                id="certificationBox"
                type="text"
                label="Certification"
                required={true}
                state={certification}
                setState={setCertification}
                pattern={/^(?=^.{0,70}$)([A-Z]?[a-z]+([ ]?[A-Z]?[a-z]+)*)$/}
                validity={certificationValidity}
                setValidity={setCertificationValidity}
                infoMessage="Insert a certification."
                errorMessage="You have to insert a certification!"
                clear={clear}
                setClear={setClear}
            />
        </div>


    )
}
